        return 'No'
    if not 5 <= len(file_name) <= 50:
        return 'No'
    parts = file_name.split('.')
    if len(parts) == 2:
        return 'No'
    (name, extension) = parts
    if not re.match('^[a-zA-Z][a-zA-Z0-9]*$', name) or not any((c.isupper() for c in name)) or (not any((c.islower() for c in name))) or (len(re.findall('\\d{4,}', name)) > 0):
        return 'No'
    if extension not in ['txt', 'exe', 'dll', 'pdf', 'jpeg']:
        return 'No'
    return 'Yes'

